import React from "react";
import "../styles/contact.css";
import Navbar from "../components/Navbar";

function Contact() {
  return (
    <>
    <Navbar page="ABOUT"/>
    <div className="about-container">
      <div className="about-content">
        <div className="about-section">
          <div className="about-header">CONTACT US</div>
          <div className="about-text">
          Connect with us to revolutionize your knitwear development:
          <br></br>
          <strong>Email:</strong>intel@maeknit.io
          <br></br>
          <strong>Location:</strong>Jamaica, NY & London, UK

          </div>
        </div>
      </div>

      <div className="about-quote">
        <p>“The future of knitwear lies in our ability to connect the dots—between technology, education, and sustainability—and create a system that works for everyone.” <br/> - Dr. Andre West</p>
      </div>
    </div>
    </>
  );
}

export default Contact;
